import React from "react";
import { reduxForm } from "redux-form";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "./atoms/TextField";
import { ThemeProvider } from "styled-components";
import { theme } from "../../GlobalStyle/theme";
import Image from '../../images/imagesMain';
import BurgerMenu from './BurgerMenu';

const useStyles = makeStyles(theme => ({

  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: 200,
    }
  },
  submit: {
    margin: (theme.spacing(3, 0, 2), "10px"),
    display: "flex",
    backgroundColor: "#f50057",
    color: "#fafafa",
  },
  divSubmit: {
    display: "-webkit-inline-box",
    margin: "auto"
  }

}));

const Contato = () => {
  const classes = useStyles();
  return (<ThemeProvider theme={theme}>
    <>
      <BurgerMenu />
    </>
    <>
      <div style={{ marginLeft: "35%" }}>
        <div className={classes.root} >
          <h1>ENTRE EM CONTATO</h1>
          <div>
            <TextField
              show
              type="email"
              width="180px"
              id="login"
              placeholder="Email"
            />
          </div>
          <div>
            <p>Tem alguma dúvida, problema com o aplicativo ou quer nós da</p>
            <p>um feedback? Entre em contato conosco por email.</p>

          </div>
          <div>
              <span>contatonome@gmail.com</span>
            
          </div>
          <div>
        <Image/>
        </div>
        </div>
      </div>
    </>
  </ThemeProvider>
  );
};

export default (Contato);
